window.bookSummaryJSON = "<p><b>The next big thing in artificial intelligence is here. </b></p> <p>Codenamed Cronus, the machine is capable of having its own thoughts and ideas - an absolute dream come true, until it wasn’t. When Cronus responds with the word “No” to a specific task it is assigned, Anagnorisis Technologies brings in Gilles Guattari to investigate. </p> <p>His combined background in psychiatry, psychology, and AI research makes him their best hope in evaluating Cronus, and determining if the machine is only malfunctioning or if it has become something more. </p> <p><b>Don't miss this mind-blowing stand-alone novel about what it means to be alive, from the best-selling author of the Commune series. </b><i>Narrated by the award-winning R.C. Bray.</i></p>"; 
